import React from "react";
import {
  Card,
  CardMedia,
  CardContent,
  Typography,
  CardActions,
  Button,
} from "@material-ui/core";

const Mem = (props) => {
  return (
    <div>
      <Card>
        <CardMedia
          style={{ height: 60, padding: 15 }}
          image="./data/mems/dieta.jpg"
          title={props.mem.ftitle}
        />
        <CardContent>
          <Typography gutterBottom variant="headline" component="h2">
            {props.mem.title}
          </Typography>
        </CardContent>
        <CardActions>
          <Button size="small" color="primary">
            Upvote
          </Button>
          <p>{props.mem.upvotes}</p>
          <Button size="small" color="primary">
            Unvote
          </Button>
          <p>{props.mem.downvotes}</p>
        </CardActions>
      </Card>
    </div>
  );
};

export default Mem;
